    navigate('/tasks');
  }
  return(<div className='contain-body'>
    <MajorButton 
    todayTracker={props.todayTracker}/>
    <div className='add' onClick={handleClick}>
      <img src={Add} alt='add button' className='add-button'/>
      <span>tasks</span>
    </div>
  </div>)
}
